import { NgModule } from '@angular/core';
import { RouterModule } from '@angular/router';

@NgModule({
    imports: [
        RouterModule.forChild([
            {
                path: 'ves',
                data: { pageTitle: 'nspay2App.payroll.ves.home.title' },
                loadChildren: () => import('./ves/ves.module').then(m => m.VesModule),
            },
            {
                path: 'payroll',
                data: { pageTitle: 'nspay2App.payroll.payroll.home.title' },
                loadChildren: () => import('./payroll/payroll.module').then(m => m.PayrollModule),
            },
            {
                path: 'approval',
                data: { pageTitle: 'nspay2App.payroll.approval.home.title' },
                loadChildren: () => import('./approval/approval.module').then(m => m.ApprovalModule),
            },
            {
                path: 'mass-upload',
                data: { pageTitle: 'nspay2App.payroll.approve.home.title' },
                loadChildren: () => import('./mass-upload/mass-upload.module').then(m => m.MassUploadModule),
            }
        ]),
    ],
})
export class PayrollRoutingModule { }
